import React from 'react';
import { useParams } from 'react-router-dom';

const ViewProfile = () => {
  const { name } = useParams();
  const userData = { name: 'Jack Brown', age: 21, major: 'Business Administration: Finance', hobbies: 'Golfing, Surfing, Gym', careerAspirations: 'Financial Consulting', img: `images/jb-profile.jpeg`};
  ;

  return (
    <div>
      <h1>{userData.name}</h1>
      <p>Age: {userData.age}</p>
      <p>Major: {userData.major}</p>
      <p>Hobbies: {userData.hobbies}</p>
      <p>Career Aspirations: {userData.careerAspirations}</p>
    </div>
  );
};

export default ViewProfile;
